import{_ as e,o as t,c as a,V as s}from"./chunks/framework.4acca30d.js";const i="/assets/image-20201117102800146.c074d991.png",p="/assets/image-20201117102946811.2a62e18f.png",o="/assets/image-20201117103016290.8cdd209d.png",r="/assets/image-20201117103048200.0f7bdb0c.png",n="/assets/image-20201117103321513.fe96c09b.png",c="/assets/image-20201117103822423.f55165b3.png",m="/assets/image-20201117104054797.eb4b46c4.png",l="/assets/image-20201117104229236.9136c163.png",g="/assets/f1c16115-6c85-4fa4-b0fa-5f0d436a167d.49dbd9f7.png",d="/assets/image-20201117104445070.8acd9793.png",_="/assets/image-20201117104502139.34d2b114.png",h="/assets/image-20201117104715582.141b95e0.png",f="/assets/image-20201117104939594.27d9dbb0.png",b="/assets/image-20201117105001205.a81acb6a.png",u="/assets/image-20201117105104639.89e3224f.png",v="/assets/image-20201117105310913.4d63a72a.png",q="/assets/image-20201117110314667.0eff27cb.png",S="/assets/image-20201117110352018.a1c841a4.png",$=JSON.parse('{"title":"iOS App 证书申请流程","description":"","frontmatter":{"title":"iOS App 证书申请流程","catalog":true,"date":"2020-11-20T16:50:00.000Z","subtitle":null,"header-img":null,"tags":["GitLab"]},"headers":[],"relativePath":"docs/frontend/hybird/ios-cert.md","filePath":"docs/frontend/hybird/ios-cert.md"}'),D={name:"docs/frontend/hybird/ios-cert.md"},A=s('<h1 id="ios-app-证书申请流程" tabindex="-1">iOS App 证书申请流程 <a class="header-anchor" href="#ios-app-证书申请流程" aria-label="Permalink to &quot;iOS App 证书申请流程&quot;">​</a></h1><p>参考链接 <a href="https://ask.dcloud.net.cn/article/152" target="_blank" rel="noreferrer">https://ask.dcloud.net.cn/article/152</a></p><p>打开 <a href="https://developer.apple.com/account/resources/certificates/list" target="_blank" rel="noreferrer">https://developer.apple.com/account/resources/certificates/list</a></p><p><img src="'+i+'" alt="image-20201117102800146"></p><h2 id="生成-identifiers-app-的唯一标识" tabindex="-1">生成 Identifiers （App 的唯一标识） <a class="header-anchor" href="#生成-identifiers-app-的唯一标识" aria-label="Permalink to &quot;生成 Identifiers （App 的唯一标识）&quot;">​</a></h2><p><img src="'+p+'" alt="image-20201117102946811"></p><p><img src="'+o+'" alt="image-20201117103016290"></p><p><img src="'+r+'" alt="image-20201117103048200"></p><p><img src="'+n+'" alt="image-20201117103321513"></p><p><img src="'+c+'" alt="image-20201117103822423"></p><h2 id="生成证书请求文件" tabindex="-1">生成证书请求文件 <a class="header-anchor" href="#生成证书请求文件" aria-label="Permalink to &quot;生成证书请求文件&quot;">​</a></h2><p>不管是申请开发 (Development) 证书还是发布 (Distribution) 证书，都需要使用证书请求 (.certSigningRequest) 文件，证书请求文件需在 Mac OS 上使用 “钥匙串访问” 工具生成。</p><p><img src="'+m+'" alt="image-20201117104054797"></p><p><img src="'+l+'" alt="image-20201117104229236"></p><p><img src="'+g+'" alt="img"></p><h2 id="申请开发-development-证书和描述文件" tabindex="-1">申请开发(Development)证书和描述文件 <a class="header-anchor" href="#申请开发-development-证书和描述文件" aria-label="Permalink to &quot;申请开发(Development)证书和描述文件&quot;">​</a></h2><p>开发(Development)证书及对应的描述文件用于开发阶段使用，可以直接将 App 安装到手机上，一个描述文件最多绑定 100 台测试设备（开发证书不能用于发布应用到 App Store）。</p><p>在证书管理页面选择 “Certificates&quot; 可查看到已申请的所有证书（TYPE：Development 为开发证书，Distribution 为发布证书），点击页面的加号来创建一个新的证书：</p><p><img src="'+d+'" alt="image-20201117104445070"></p><p><img src="'+_+'" alt="image-20201117104502139"></p><p>接下来需要用到刚刚生成的证书请求文件，点击“Choose File...”选择刚刚保存到本地的 “CertificateSigningRequest.certSigningRequest”文件，点击 “Continue” 生成证书文件：</p><p><img src="'+h+'" alt="image-20201117104715582"></p><p>双击保存到本地的 ios_development.cer 文件，会自动打开 “钥匙串访问” 工具说明导入证书成功，可以在证书列表中看到刚刚导入的证书，接下来需要导出 .p12 证书文件，选中导入的证书，右键选择 “导出...”：</p><p><img src="'+f+'" alt="image-20201117104939594"></p><p><img src="'+b+'" alt="image-20201117105001205"></p><p><img src="'+u+'" alt="image-20201117105104639"></p><p>至此，我们已经完成了开发证书的制作（得到了 xxx.p12 证书文件），接下来，继续生成开发阶段所需的描述文件，在生成描述文件之前，需要先添加调试设备（iPhone 、iPad）</p><h2 id="添加调试设备" tabindex="-1">添加调试设备 <a class="header-anchor" href="#添加调试设备" aria-label="Permalink to &quot;添加调试设备&quot;">​</a></h2><p>开发描述文件必须绑定调试设备，只有授权的设备才可以直接安装 App，所以在申请开发描述文件之前，先添加调试的设备。</p><p>在证书管理页面选择 “Devices”，可查看到已添加的所有设备信息，点击页面上的加号来添加一个新设备：</p><p><img src="'+v+'" alt="image-20201117105310913"></p><p>UDID 可以通过 ITunes 等工具获取</p><h2 id="申请开发-development-描述文件" tabindex="-1">申请开发 (Development) 描述文件 <a class="header-anchor" href="#申请开发-development-描述文件" aria-label="Permalink to &quot;申请开发 (Development) 描述文件&quot;">​</a></h2><p>在证书管理页面选择 “Profiles”，可查看到已申请的所有描述文件，点击页面上的加号来添加一个新的描述文件：</p><p><img src="'+q+'" alt="image-20201117110314667"></p><p><img src="'+S+'" alt="image-20201117110352018"></p><p>接下来选择需要绑定的证书，这里建议直接勾选 “Select All”，点击“Continue”</p><p>选择授权调试设备，这里建议直接勾选 “Select All”，点击 “Continue”</p><p>点击“Download”下载保存开发描述文件（文件后缀为 .mobileprovision）</p><p>至此，我们已经得到了开发证书（.p12）及对应的描述文件（.mobileprovision），接下看一下如何制作发布证书及发布描述文件</p>',40),P=[A];function k(x,C,T,I,O,R){return t(),a("div",null,P)}const y=e(D,[["render",k]]);export{$ as __pageData,y as default};
